import Card from '../UI/Card';
import { Fragment } from 'react';
import styleClasses from '../../CSS/Login/Login.module.css'
const Login = (props) => {
    return (
        <Fragment>
            <Card className={styleClasses.wrapper_class}>
                <h4 className={styleClasses.form_header}>Login</h4>
                <form>
                    <div className={styleClasses.login_fields}>
                        <div className={styleClasses.login_field}>
                            <label htmlFor='UserEmail'>Email</label>
                            <input type="text" id='UserEmail' />
                        </div>
                        <div className={styleClasses.login_field}>
                            <label htmlFor='UserPassword'>Password</label>
                            <input type="password" id='UserPassword' />
                        </div>
                    </div>
                    <div>
                        <a href="#" className={styleClasses.button}>Login</a>
                        {/* <button type="submit" className={styleClasses.button_animation}>Login</button> */}
                    </div>
                </form>
            </Card>
        </Fragment>
    );
}

export default Login;
